mapper.select:

select 

from NPSBATCH
where NPSBATCH_FILE_ID = #{npsbatchFileId,jdbcType=CHAR}
  and NPSBATCH_TX_DATE = #{npsbatchTxDate,jdbcType=CHAR}
  and NPSBATCH_BATCH_NO = #{npsbatchBatchNo,jdbcType=CHAR}

mapper.delete:

delete from NPSBATCH
where NPSBATCH_FILE_ID = #{npsbatchFileId,jdbcType=CHAR}
  and NPSBATCH_TX_DATE = #{npsbatchTxDate,jdbcType=CHAR}
  and NPSBATCH_BATCH_NO = #{npsbatchBatchNo,jdbcType=CHAR}
